import React from "react";

class NewGoalButton extends React.Component {
    constructor(props){
        super(props);
        this.state = {
            goal:0
        }
    }
    
    newGoal() {
        alert("New goal detected!")
    }

    render(){
        return(
            <div>
                <button className="button" onClick={this.newGoal}>
                    New Goal
                </button>
            </div>
        )
    }
}

export default NewGoalButton;
